import React, {useState} from 'react';
import arrow from './images/icon-arrow.svg';
import error from './images/icon-error.svg';

const [initial,setInitial] = useState({
    email:{emailValue},
    message:'',
    image:{error}
})

const emailValue = (event) => 
    event.target.value;




function emailSubmit(){
setInitial({
    email:'',
    message:'',
    image:{error}
})
}


const Email = () => {
    return(
        <form className='emailContainer'>
            <input onChange={emailValue} type='email' placeholder='Email Address'></input>
            <input onClick={emailSubmit} className='arrow' type='image' src={arrow} alt='arrow'/> 
            <img src={initial.image} alt='error'></img>
            <p></p>
        </form>
    )
}

export default Email;
